// DeleteUniqueIndexCache 删除索引存在的缓存
func (s *SensitiveWordRepo) DeleteIndexCache(ctx context.Context, data ...*ai_boilerplate_model.SensitiveWord) error {
	KeyMap := make(map[string]struct{})
	keys := make([]string, 0)
	keys = append(keys, s.cache.Key(CacheSensitiveWordByConditionPrefix))
	keys = append(keys, s.cache.Key(CacheSensitiveWordUnscopedByConditionPrefix))
	for _, item := range data {
		if item != nil {
			KeyMap[s.cache.Key(CacheSensitiveWordByIDPrefix, item.ID)] = struct{}{}
			KeyMap[s.cache.Key(CacheSensitiveWordUnscopedByIDPrefix, item.ID)] = struct{}{}
			KeyMap[s.cache.Key(CacheSensitiveWordByWordPrefix, item.Word)] = struct{}{}
			KeyMap[s.cache.Key(CacheSensitiveWordUnscopedByWordPrefix, item.Word)] = struct{}{}
		}
	}
	for item := range KeyMap {
		keys = append(keys, item)
	}
	err := s.cache.DelBatch(ctx, keys)
	if err != nil {
		return err
	}
	return nil
}
